PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE `_migrations` (file VARCHAR(255) PRIMARY KEY NOT NULL, applied INTEGER NOT NULL);
CREATE TABLE `_collections` (
				`id`         TEXT PRIMARY KEY,
				`system`     BOOLEAN DEFAULT FALSE NOT NULL,
				`type`       TEXT DEFAULT "base" NOT NULL,
				`name`       TEXT UNIQUE NOT NULL,
				"fields"     JSON DEFAULT "[]" NOT NULL,
				`listRule`   TEXT DEFAULT NULL,
				`viewRule`   TEXT DEFAULT NULL,
				`createRule` TEXT DEFAULT NULL,
				`updateRule` TEXT DEFAULT NULL,
				`deleteRule` TEXT DEFAULT NULL,
				`options`    JSON DEFAULT "{}" NOT NULL,
				`created`    TEXT DEFAULT "" NOT NULL,
				`updated`    TEXT DEFAULT "" NOT NULL
			, `indexes` JSON DEFAULT "[]" NOT NULL);
CREATE TABLE `users` (`avatar` TEXT DEFAULT '', `created` TEXT DEFAULT '' NOT NULL, `email` TEXT DEFAULT '' NOT NULL, `emailVisibility` BOOLEAN DEFAULT FALSE NOT NULL, `id` TEXT PRIMARY KEY, `name` TEXT DEFAULT '', "password" TEXT NOT NULL, `tokenKey` TEXT NOT NULL, `updated` TEXT DEFAULT '' NOT NULL, `username` TEXT NOT NULL, `verified` BOOLEAN DEFAULT FALSE NOT NULL, "file" TEXT DEFAULT '', "rel" TEXT DEFAULT '');
CREATE TABLE `demo1` (`created` TEXT DEFAULT '' NOT NULL, `id` TEXT PRIMARY KEY, `updated` TEXT DEFAULT '' NOT NULL, "text" TEXT DEFAULT '', "bool" Boolean DEFAULT FALSE, "url" TEXT DEFAULT '', "select_one" TEXT DEFAULT '', "file_one" TEXT DEFAULT '', "file_many" TEXT DEFAULT '', "number" REAL DEFAULT 0, "email" TEXT DEFAULT '', "datetime" TEXT DEFAULT '', "json" JSON DEFAULT NULL, "rel_one" TEXT DEFAULT '', "select_many" TEXT DEFAULT '', "rel_many" JSON DEFAULT '[]' NOT NULL, "point" JSON DEFAULT '{"lat":0,"lon":0}' NOT NULL);
CREATE TABLE `demo2` (`created` TEXT DEFAULT '' NOT NULL, `id` TEXT PRIMARY KEY, `title` TEXT DEFAULT '', `updated` TEXT DEFAULT '' NOT NULL, "active" Boolean DEFAULT FALSE);
CREATE TABLE `demo3` (`created` TEXT DEFAULT '' NOT NULL, `id` TEXT PRIMARY KEY, `title` TEXT DEFAULT '', `updated` TEXT DEFAULT '' NOT NULL, "files" TEXT DEFAULT '');
CREATE TABLE `demo4` (`created` TEXT DEFAULT '' NOT NULL, `id` TEXT PRIMARY KEY, `title` TEXT DEFAULT '', `updated` TEXT DEFAULT '' NOT NULL, "rel_one_no_cascade" TEXT DEFAULT '', "rel_one_no_cascade_required" TEXT DEFAULT '', "rel_one_cascade" TEXT DEFAULT '', "self_rel_one" TEXT DEFAULT '', "json_array" JSON DEFAULT NULL, "json_object" JSON DEFAULT NULL, "rel_one_unique" TEXT DEFAULT '' NOT NULL, "rel_many_no_cascade" JSON DEFAULT '[]' NOT NULL, "rel_many_no_cascade_required" JSON DEFAULT '[]' NOT NULL, "rel_many_cascade" JSON DEFAULT '[]' NOT NULL, "rel_many_unique" JSON DEFAULT '[]' NOT NULL, "self_rel_many" JSON DEFAULT '[]' NOT NULL);
CREATE TABLE `clients` (`created` TEXT DEFAULT '' NOT NULL, `email` TEXT DEFAULT '' NOT NULL, `emailVisibility` BOOLEAN DEFAULT FALSE NOT NULL, `id` TEXT PRIMARY KEY, `name` TEXT DEFAULT '', "password" TEXT NOT NULL, `tokenKey` TEXT NOT NULL, `updated` TEXT DEFAULT '' NOT NULL, `username` TEXT NOT NULL, `verified` BOOLEAN DEFAULT FALSE NOT NULL);
CREATE TABLE IF NOT EXISTS "nologin" (`created` TEXT DEFAULT '' NOT NULL, `email` TEXT DEFAULT '' NOT NULL, `emailVisibility` BOOLEAN DEFAULT FALSE NOT NULL, `id` TEXT PRIMARY KEY, `name` TEXT DEFAULT '', "password" TEXT NOT NULL, `tokenKey` TEXT NOT NULL, `updated` TEXT DEFAULT '' NOT NULL, `username` TEXT NOT NULL, `verified` BOOLEAN DEFAULT FALSE NOT NULL);
CREATE TABLE `demo5` (`created` TEXT DEFAULT '' NOT NULL, `id` TEXT PRIMARY KEY NOT NULL, `rel_many` TEXT DEFAULT '', `rel_one` TEXT DEFAULT '', `select_many` TEXT DEFAULT '', `select_one` TEXT DEFAULT '', `updated` TEXT DEFAULT '' NOT NULL, "total" REAL DEFAULT 0, "file" TEXT DEFAULT '');
CREATE TABLE IF NOT EXISTS "_superusers" (`created` TEXT DEFAULT '' NOT NULL, `email` TEXT DEFAULT '' NOT NULL, `emailVisibility` BOOLEAN DEFAULT FALSE NOT NULL, `id` TEXT PRIMARY KEY DEFAULT ('r'||lower(hex(randomblob(7)))) NOT NULL, `password` TEXT DEFAULT '' NOT NULL, `tokenKey` TEXT DEFAULT '' NOT NULL, `updated` TEXT DEFAULT '' NOT NULL, `verified` BOOLEAN DEFAULT FALSE NOT NULL);
CREATE TABLE IF NOT EXISTS "_externalAuths" (`collectionRef` TEXT DEFAULT '' NOT NULL, `created` TEXT DEFAULT '' NOT NULL, `id` TEXT PRIMARY KEY DEFAULT ('r'||lower(hex(randomblob(7)))) NOT NULL, `provider` TEXT DEFAULT '' NOT NULL, `providerId` TEXT DEFAULT '' NOT NULL, `recordRef` TEXT DEFAULT '' NOT NULL, `updated` TEXT DEFAULT '' NOT NULL);
CREATE TABLE `_params` (`created` TEXT DEFAULT '' NOT NULL, `id` TEXT PRIMARY KEY DEFAULT ('r'||lower(hex(randomblob(7)))) NOT NULL, `updated` TEXT DEFAULT '' NOT NULL, `value` JSON DEFAULT NULL);
CREATE TABLE IF NOT EXISTS "_mfas" (`collectionRef` TEXT DEFAULT '' NOT NULL, `created` TEXT DEFAULT '' NOT NULL, `id` TEXT PRIMARY KEY DEFAULT ('r'||lower(hex(randomblob(7)))) NOT NULL, `method` TEXT DEFAULT '' NOT NULL, `recordRef` TEXT DEFAULT '' NOT NULL, `updated` TEXT DEFAULT '' NOT NULL);
CREATE TABLE IF NOT EXISTS "_otps" (`collectionRef` TEXT DEFAULT '' NOT NULL, `created` TEXT DEFAULT '' NOT NULL, `id` TEXT PRIMARY KEY DEFAULT ('r'||lower(hex(randomblob(7)))) NOT NULL, `password` TEXT DEFAULT '' NOT NULL, `recordRef` TEXT DEFAULT '' NOT NULL, `updated` TEXT DEFAULT '' NOT NULL, "sentTo" TEXT DEFAULT '' NOT NULL);
CREATE TABLE IF NOT EXISTS "_authOrigins" (`collectionRef` TEXT DEFAULT '' NOT NULL, `created` TEXT DEFAULT '' NOT NULL, `fingerprint` TEXT DEFAULT '' NOT NULL, `id` TEXT PRIMARY KEY DEFAULT ('r'||lower(hex(randomblob(7)))) NOT NULL, `recordRef` TEXT DEFAULT '' NOT NULL, `updated` TEXT DEFAULT '' NOT NULL);
ANALYZE sqlite_schema;
